import * as api from "../Api/helperApis.js";

export function addNewTeam(NewTeamName) {
  console.log(api.createNewTeam(NewTeamName), "api.createNewTeam(NewTeamName)");
  return api.createNewTeam(NewTeamName);
}
export const AddTeam = (NewTeamName) => async (dispatch) => {
  try {
    const data = await helperApi.addNewTeam(NewTeamName);
    console.log(data, "Dataaaaaaaaaaaa", NewTeamName);
    dispatch({ type: "UPDATE_TEAMS", payload: data });
  } catch (err) {
    console.log(err);
  }
};
